Taiwan has abundant biodiversity, including more than 600 bird species, thanks to the various climates and vegetation types along its almost 4000 m elevation gradient. Although bird traits have been found to be an important determinant of the diversity pattern and species composition of both native (
Ding et al. 2005
) and invasive birds in Taiwan (
Su et al. 2016
), a comprehensive dataset on bird traits is still lacking. Therefore, in this study, we compiled the information on 23 traits, including morphological, behaviour, distributional and life-history traits, for all breeding birds in Taiwan. This structured and relatively comprehensive trait dataset can support trait-based research and diverse applications on Taiwan's breeding birds. For example, several traits, related to thermal tolerance, diets and habitat use, have been associated with birds altitudinal migration tendencies to explore potential drivers of this behaviour (Tsai et al., in review). This dataset may also improve our ecological and evolutionary understanding of the community assembly in an island-like system (
Mittelbach and Schemske 2015
, 
Weber et al. 2017
).

We obtained information on 23 traits for Taiwan's 171 breeding bird species from seven sources (Table 
1
):

The Checklist of Birds of Taiwan issued by Chinese Wild Bird Federation (CWBF; 
CWBF 2017
);

The Avifauna of Taiwan (
Severinghaus et al. 2010
);

The Handbook of the Birds of the World Alive (HBW Alive; 
Del Hoyo et al. 2018
);

The EltonTraits dataset (ver. 1.0; 
Wilman et al. 2014
);

Our own calculations by overlapping bird occurrence records from eBird (
Sullivan et al. 2009
) and the environmental data layers of elevation (Global Digital Elevation Models GDEM; https://gisgeography.com/free-global-dem-data-sources) and temperatures (Climatologies at High Resolution for the 
Earth's
Land Surface Areas CHELSA; 
Karger et al. 2017
).

One trait, residency, belongs to the category of movement. According to the Checklist of Birds of Taiwan (
CWBF 2017
), the residency of birds can be classified into six types: residents, summer visitors, winter visitors, passage migrants, straggers and introduced species. Although our dataset focuses on the trait information for the resident and summer visitor species in Taiwan, some of those species also contain winter visiting or passage migratory populations. Therefore, we used four binary variables to indicate whether a species contains a population of each of the four residency types (Table 
2
).

Four traits, lower and upper elevation boundaries and lower and upper temperature boundaries, are under the category of distribution (Table 
1
). To estimate the boundaries, we obtained the occurrence records of all the 171 species from the eBird database (downloaded on 16 March 2018; 
Sullivan et al. 2009
) and used only the records collected after the year of 2000 within the study area. We obtained the elevation for each of the occurrence locations, based on the data layer from the ASTER Global Digital Elevation Models (v2; https://search.earthdata.nasa.gov/search/). To account for the uncertainty in GPS locating, we calculated the mean elevation within 100 m of each location. We then calculated the 2.5th and the 97.5th percentiles of the mean elevation values for each species as the lower and upper elevation boundaries, respectively, of the distribution range of the species in Taiwan. For the temperature boundaries of species distribution ranges, we obtained the temperature values for the same occurrence dataset, based on the time series data layers of the Climatologies at High Resolution for the 
Earth's
Land Surface Areas (http://chelsa-climate.org/; 
Karger et al. 2017
). For each occurrence record, we obtained the mean temperature of the month when the record was collected in the field. We then calculated the 2.5th and the 97.5th percentiles of the mean values for each species as the lower and upper temperature boundaries, respectively. Due to the limited availability of the time series temperature data, we only used the occurrence records collected between 2000 and 2013 for this calculation.

We obtained the information on the activity time, diet and foraging stratum of the bird species from the EltonTraits dataset (
Wilman et al. 2014
) by subsetting the dataset for the 171 breeding bird species in Taiwan. Therefore, the information on the three traits in our dataset is the same as that in the EltonTraits dataset. The reason for including the information was for completeness. The original information sources and the approaches for compiling the information can be found in Wilman et al. (2014).

We obtained information on habitat use of the bird species from the Avifauna of Taiwan (
Severinghaus et al. 2010
) and defined the habitat types following the habitats classification scheme used by the Red List of Threatened Species of the International Union for Conservation of Nature (IUCN; https://www.iucnredlist.org/resources/habitat-classification-scheme). Thirteen of the 18 IUCN first-level habitat types were used by the 171 breeding bird species in Taiwan and, thus, 13 binary variables were included in our dataset to indicate which habitat types were used by each of the species (Table 
2
).

Eight traits, including the clutch size, incubation period, egg length, egg width, brood parasitism, nest structure, nest site and nest attachment, are in the trait category of breeding (Table 
1
). The mean values of the clutch size and incubation period were calculated for each species from the measurements on individual broods reported in the Avifauna of Taiwan (
Severinghaus et al. 2010
), while the mean values of the egg length and egg width were from the measurements on individual eggs. When the measurements on individual broods or eggs were not available, we calculated the mean of the maximum and minimum values reported in the Avifauna of Taiwan (
Severinghaus et al. 2010
) or the HBW Alive (
Del Hoyo et al. 2018
). The information on the data source, sample size and calculation method for the four traits of each species is provided in Table 
3
.

We obtained the information on the nest structure, nest site and nest attachment approaches from the HBW Alive (
Del Hoyo et al. 2018
) and defined seven, seven and four types of the three traits (Table 
1
), respectively, following 
Fang et al. (2018)
. As a single species may build nests with more than one type of structure, site and/or attachment, we used seven, seven and four binary variables to indicate the types of the three traits, respectively, for each species (Table 
2
). Some bird species do not build their own nests, but lay their eggs in the nests of other species and rely on the hosts to raise their offspring. Therefore, we included another trait, brood parasitism, to indicate the brood parasite species, whose nest traits cannot be defined.

Taiwan, including Taiwan's main island, Penghu Islands, Green Island, Lanyu Island, Guishan Island and the Three Northern Islands (Fig. 
1
).

This dataset contains 23 traits, grouped into 7 catogories (Table 
1
).
